    for i=1:length(unique_hsm)
        ind = find(unique_hsm(i) == hsm_vec);
        s = unique_hsm(i);
        sby2 = ceil(s/2);
        rgk = imresize(gk, [s s]);
        for j=1:length(ind)

            rgk = rgk - min(rgk(:));
            rgk = rgk ./ max(rgk(:));            
            
            rgk = rgk .* (max_val(ind(j)) - min_val(ind(j)));            
            rgk = rgk + min_val(ind(j));
            
            curr_row = y(ind(j));
            curr_col = x(ind(j));            
            
%             curr_row = size(hsm, 1)-5; % remove after debugging
            
            rst = curr_row - sby2;
            ren = rst + s - 1;
            cst = curr_col - sby2;
            cen = cst + s - 1;
            
            grst = max(rst, 1);
            gren = min(ren, size(hsm, 1));
            gcst = max(cst, 1);
            gcen = min(cen, size(hsm, 2));
            
            pad = -2; % set pad = -2 for equvalent result of previous version of code
            
            if rst < 1; krst = abs(rst - 1) + 1;
            else krst = 1; end            
%             krst = abs(min(rst+pad, 1));
            kren = krst + gren-grst;

            if cst < 1; kcst = abs(cst - 1) + 1;
            else kcst = 1; end               
%             kcst = abs(min(cst+pad, 1));
            kcen = kcst + gcen-gcst;
            
            rdim = kren-krst+1;
            cdim = kcen-kcst+1;
            
            info(ind(j), :) = [grst, gren, gcst, gcen, rdim, cdim];
            gaussians(1:rdim, 1:cdim, ind(j)) = rgk( krst:kren, kcst:kcen);
%             gaussian_field(grst:gren, gcst:gcen) = gaussian_field(grst:gren, gcst:gcen) + rgk( krst:kren, kcst:kcen);            
        end
    end
end